import React from 'react'

export default function WatchingVideo_left() {
    // const {loading, error, data}=useQuery(videoPlaying);
    // if(loading) return <p>loading...</p>;
    // if (error) return `Error! ${error.message}`;

    return ( <
        div className = "col-xl-8 col-lg-8 col-md-10 col-sm-10 mx-auto d-md-flex videoPlaying" >
        <
        div className = "card border"
        style = {
            { marginTop: '50px' } } >
        <
        WatchingVideo_left_top > < /WatchingVideo_left_top> <
        WatchingVideo_left_bot > < /WatchingVideo_left_bot> <
        /div> <
        /div>
    )
}
